import { Card, CardHeader, CardMedia, Typography } from '@mui/material';

export default function Project(){
    return (
        <Card
            sx={{
                height: 350,
                width: 300,
                margin: 5,
                display: 'flex'
            }}
        >
            <CardHeader
                title={<Typography variant="h3">Good Flicks</Typography>}
            />
            <CardMedia
                component="img"
                image="GoodFlicks.png"
                alt="Paella dish"
                sx={{
                    height: 100,
                    width: 100,
                    justifyContent: "center"
                }}
            />
        </Card>
    )
}
